        <div class="lg:max-w-screen-xl max-w-screen-md mx-auto px-4 sm:px-6 lg:px-8 pt-7 relative">
                <h2 class="2xl:text-8xl mt-20 lg:text-7xl md:text-6xl text-5xl !font-bold dark-gray mb-4 playfair-display-500 tracking-tighter md:more-neg-letter leading-tight">Who delivers the messages?
                </h2>
                <div class="mt-4 lg:mt-10 flex z-10 flex-col gap-5">
                    <div class="flex flex-row gap-8 items-start">
                        <div class="flex flex-col flex-wrap gap-4">
                            <h2 class="2xl:text-6xl lg:text-5xl text-4xl mb-0 lg:mb-10 !font-bold text-dark-gray-60 playfair-display-500 md:neg-letter tracking-tighter">Lyndsey Smith</h2>
                            <div class="flex items-center flex-col lg:flex-row gap-3 sm:p-0 z-20">
                        <div class="flex flex-col gap-4">
                            <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">I see the universe as my main teacher, along with every person I encounter on my path. Everyone teaches me something new. I observe patterns, actions, and their consequences in the world around me.</p>
                         
                            <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">I've never had formal training in the traditional sense. My only brush with structured learning was a brief six-week online course with <a class="underline link" target="_blank" href="https://andy-porter.co.uk/">Andy Porter</a>, and that's it. I believe this gives me a unique edge. Often, formal education can box you into a set of rigid beliefs. But beliefs should be like water, flowing and adapting. Those who cling to outdated beliefs can stunt their own spiritual growth and limit their ability to guide others.</p>
                            <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">I must give credit to <a class="link underline" target="_blank" href="https://paigegarciaqh.com/">Page Garcia</a> and the group of women present in our group healings as well. My experience with them was transformational. The person I was when I met them and the person, I am now, are two completely different people. You are all very talented in your work - thank you for the love and guidance you have given me.</p>
                            <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">Born in May 1986 in a small Ohio town near Akron, my early years were tough. My childhood was clouded, marked by struggles, leading me into a battle with addiction later on. </p>
                        
                       
                       
                        <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">Yet, this dark period shaped me, and I regret none of it. I've been clean since February 2018, and at 33, I embarked on an academic journey, earning a bachelor's degree in IT by May 2023.</p>
                        <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">By day, I'm a developer, and I genuinely enjoy coding. It's not just work; it's where I get to be creative, to build stuff that people can see and use. It's my way of putting my mark on the world, and that feels pretty damn good.</p>
                        <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">When the workday ends and the weekend hits, I switch gears to focus on healing. It's not just a hobby; it's like a calling. I spend those quiet hours diving deep into meditation, searching for peace inside myself and working on energy healing. It's my time to recharge and help heal, whether it's me or someone else.</p>
                        </div>
                    </div>
