                    <h2 class="2xl:text-6xl lg:text-5xl text-4xl !font-bold text-dark-gray-60 playfair-display-500 neg-letter">My Healing Journey</h2>
                    <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">I remember watching Tyler Henry the medium for the Stars when I was in my active addiction. I would get goosebumps watching him and at that time I didnt feel anything. I even cried in happiness. Watching him was the only time I felt anything. Something inside of me activated. I didnt know it at the time, but my soul was trying to reach me. That was the catalyst of my healing journey. </p>
                    <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">In August 2019, I experienced my initial spiritual awakening, which unfortunately veered off course. Unaware at the time, a negative entity had been influencing me since my early years. During this period, I was under the illusion that I was in telepathic communication with a famous personality. It turned out I was engaging with this malevolent entity instead. This misconception lasted several months until I made the deliberate decision to stop it, recognizing the detrimental impact of this energy. By choosing to no longer believe in this interaction, I was able to sever the connection.</p>
                    <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">During this period, I found myself wielding what felt like superhuman abilities, which came naturally through engaging with this malevolent entity. However, I was employing these powers in ways that violated universal laws. Eventually, I abandoned these capabilities, understanding their origin was malevolent. My higher self later revealed that relinquishing these powers was a critical step towards my next spiritual phase. Having lived most of my life in shadow, I recognized the darkness well; this time, I chose to ascend beyond it, leaving it behind for good. </p>
                    <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">Following that ordeal, I sought out a psychic reader. She discovered the entity that had shadowed me from childhood and freed me from its grasp. That very day marked the beginning of my second life. After nearly a decade without employment, I landed my first job, and I moved into my own place, where I reside to this day. The identity of that psychic has slipped my memory, but my gratitude towards her remains undiminished.</p>
                    <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">In March 2020, my spiritual journey took another turn. That's when I encountered Paige through a community on Facebook. My awakening was well underway, yet I was plagued by lingering negative entities, evident from my peculiar behavior. Paige introduced me to a QHHT session, and shortly after, a profound sense of relief washed over me. I will never forget afterwards; I had this big blood blister on the inside of my cheek in my mouth. Paige said that was the darkness leaving my body and I believed her. </p>
                    <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">Not long after, I began participating in group healing sessions led by Paige, along with a circle of women. This felt like the nearest I'd come to formal training in the spiritual arts. I attended each session diligently for an entire year, and during that period, I absorbed the most valuable lessons of my journey.</p>
                    <p class="!leading-relaxed 2xl:text-xl sm:text-lg text-base leading-relaxed dark-gray lora-400">In September 2023, I encountered a setbacka traumatic event that spiritually reset me to square one. Trauma has a way of sealing our heart centers, shifting our energy towards negativity. Reopening the heart and realigning with positivity is no small feat. Since that September, I've been on a path of recovery, only now beginning to emerge from the shadows. This ordeal was my dark night of the soul; at my peak, I had grown complacent, content with the knowledge I held, ceasing to seek further wisdoma critical error. We must always pursue learning. The challenge pushed me to acquire new healing tools, starting with self-healing. A dark night of the soul serves to propel us into uncomfortable territories, where true growth occurs. For much of the past year, I've been mired in negativity, but now, I'm poised to progress. Through this ordeal, I've gained profound insights, discovered my true self, and recognized my capabilitiesinsights that are unshakable.</p>
